const mongoose = require('mongoose');
const customEnv = require('custom-env');
const videoService = require('../services/videos');
const userService = require('../services/users');

customEnv.env(process.env.NODE_ENV, './config');

const users = ['default_user1', 'default_user2', 'default_user3', 'default_user4']
const pictures = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/png;base64,'
];
const thumbnails = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,'
];
videos = [`http://localhost:${process.env.SERVER_PORT}/public/videos/video1.mp4`, `http://localhost:${process.env.SERVER_PORT}/public/videos/video2.mp4`, `http://localhost:${process.env.SERVER_PORT}/public/videos/video3.mp4`];

(async () => {
    customEnv.env(process.env.NODE_ENV, './config');
    // connect to database
    const connection = await mongoose.connect(process.env.MONGO_URL);

    // populate database
    for (let i=0; i < users.length; i++) {
        username = users[i]
        const password = username + "_1234"
        const profilePicture = pictures[i];

        // create user
        const user = await userService.createUser(username, username, password, profilePicture);

        for (let j = 0; j < 5; j++) {
            const video = videos[Math.floor(Math.random() * 3)]
            const picture = thumbnails[Math.floor(Math.random() * (thumbnails.length))];
            const views = Math.floor(Math.random() * 1000);
            
            await videoService.createVideo(`default video number ${i * 5 + j}`, views, 0, Date.now(), picture,
                                         `default video description number ${i * 5 + j}`, video, user._id.toString(), []);
        }
    }
    await connection.disconnect();
    process.exit()
})();